import React from 'react';
import logo from './logo.svg';
import './App.css';

// function Header({ firstName, LastName, age }) 


function Header(props) {
  console.log(props.firstName)
  return (
    <div>
    {/* <h1>{firstName} {LastName} is my name</h1> */}
    <h1>{props.firstName} {props.LastName} is my name</h1>

    <p>About me:</p>
    <ul>
      <li>My age is {props.age}</li>
    </ul>
    </div>

  )
}

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
        {/* <Header 
          firstName = 'Sharon'
          LastName = 'Yvette'
          age={21}
          />
                  <Header 
          firstName = 'Kendall'
          LastName = 'Monet'
          age={7}
          /> */}
          <Header>Sharon</Header>

      </header>
    </div>
  );
}

export default App;
